import React from "react";
import { Button, Container  } from "shards-react";
import { Link } from '../../../routes';




export default class ProposalBar extends React.Component {

render() {
    return (  

    <div className="my-4 d-flex justify-content-center">
      <div className="card">
        <div className="card-body">
          <Container>
              
                <div className="col-sm d-flex justify-content-sm-center">
                  <div className="card-text">Vote On Current Asset Proposals</div>
                </div>  
     
            </Container>
          </div>     
        </div>
        <style jsx>{` 
                  .card-text {margin-bottom:.1rem;font-family: Poppins;column-fill:auto;}
                  .card {width:50%;margin-bottom:0;}
                  .card-body {padding:.5rem;font-size:18px;font-weight:300;} 
                  .arrow {color:#17c671;font-size:21px;font-weight:900;}
                  `}  
        </style>
    </div>

        );
    }
}
